} from "react-icons/md";

function ProductComponent({ image, price }) {
  //   console.log(props);
  function handleDetail() {
    console.log(alert("Detail Component"));
  }
  return (
    <div className="div-productcomponent" >
      <div onClick={handleDetail}  >
        <img src={image} alt="" />
        <h4>Brand : Levi's</h4>
        <h4>Size : M</h4>
        <h4>price : {price}</h4>
      </div>
      <button className="wishlist-button">
        <MdOutlineFavoriteBorder />
        wishlist
      </button> 
    </div>
  );
}

export default ProductComponent;
